objetoCompra:
- 100 (cem) canecas de cerâmica, contendo paisagens de locais e imóveis que representam  o Estado de Sergipe e o logo da JFSE, devidamente embaladas em caixinha de papelão com alça; 

- 100 (cem) gravuras confeccionadas em azulejos pintados com motivos relacionados ao Estado de Sergipe (20x20cm); 

- 100 (cem) molduras em tom madeira com fundo de eucatex branco e placa em acrílico, com a logo da JFSE colada internamente na moldura (34,2x34,2cm), inclusa tampa de papelão Kraft; e a logo da JFSE.
